var Product = require('../models/product');

var mongoose = require('mongoose');

mongoose.connect("mongodb://localhost:27017/shopingCart", {
    useUnifiedTopology: true,
    useNewUrlParser: true
  });

 var products = [
    new Product({
        imagePath: 'data:image/jpeg;base64,',
        title: 'Panado',
        description:'treat headaches, pain and fever, and toothache',
        price:40
    }),
    new Product({
        imagePath:'data:image/jpeg;base64,',
        title:'Gaviscon Double Action',
        description:'It creates a protective barrier or raft over the irritating stomach content (which is mostly acid, but also pepsin and bile).',
        price:180
    }),
    new Product({
        imagePath:'data:image/jpeg;base64,',
        title:'Folic Acid',
        description:'vitamin B₉ and folacin',
        price:65
    }),
    new Product({
        imagePath:'data:image/jpeg;base64,',
        title:'GrandPa Powder',
        description:'useful and effective for the relief of pain',
        price:100
    }),
    new Product({
        imagePath:'data:image/jpeg;base64,',
        title:'Allergex',
        description:'used for the relief of symptoms associated with allergic rhinitis ',
        price:70
    }),
    new Product({
        imagePath:'data:image/jpeg;base64,',
        title:'First Aid Kit',
        description:'A bag that holds supplies used to treat minor injuries',
        price:350
    })
];

var done = 0;

for (var i = 0; i < products.length; i++){

    products[i].save(function(err,result){
        done++;
        if(done === products.length){
            exit();
        }
    });
}

function exit(){
    mongoose.disconnect();
};


